#include <vector>

using namespace std;

int jump(vector<int>& nums) {
	int end_pos = nums.size() - 1;
	int ret = 0;
	while (end_pos != 0)
	{
		for (int i = 0; i < end_pos; i++)
		{
			if (end_pos - nums[i] <= i)
			{
				end_pos = i;
				ret++;
				break;
			}
		}
	}
	return ret;
}

int jump2(vector<int>& nums)
{
	if (nums.size() <= 1)
		return 0;
	int ret = 0;
	int max_pos = 0;
	int start_pos = 0;
	while (max_pos < nums.size())
	{
		ret++;
		int next_pos = max_pos + 1;
		for (int i = start_pos; i < next_pos; i++)
		{
			if (nums[i] + i > max_pos)
			{
				max_pos = nums[i] + i;
				
				if (max_pos >= (nums.size() - 1))
				{
					return ret;
				}
			}
		}
		
		start_pos = next_pos;
	}
}

